import mealsImage from '../../assets/meals.jpg'
import calsses from './Header.module.css'


const Header = (props) =>{
    return(
        <Fragment>
            <header className={calsses.header}>
                <h1>ReactMeals</h1>
                <button>Card</button>
            </header>
            <div className={classes['main-image']}>
                <img src={mealsImage} alt="mealsImage alt"/>
            </div>
        </Fragment>
    )
}
export default Header;
